import { useState } from "react";
import { useHistory } from "react-router-dom";
import styles from "../home.module.css";

function App() {
  const history = useHistory();

  const [ProductName, setProductName] = useState("");
  const [ProductId, setProductId] = useState("");
  const [SellerId, setSellerId] = useState("");
  const [SellerName, setSellerName] = useState("");
  const [Name, setName] = useState("");
  const [Address, setAddress] = useState("");
  const [Contact, setContact] = useState("");
  const [Mail, setMail] = useState("");
  const [Consumer, setConsumer] = useState("");


  async function AddConsumer(event) {
    event.preventDefault();

    fetch("http://localhost:4000/channels/mychannel/chaincodes/smartContract", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Authorization: "Bearer " + localStorage.getItem("token"),
      },
      body: JSON.stringify({
        fcn: "createConsumer",
        peers: ["peer0.org1.example.com", "peer0.org2.example.com"],
        chaincodeName: "smartContract",
        channelName: "mychannel",
        args: [
          Consumer,
          ProductId,
          ProductName,
          Name,
          Address,
          Contact,
          Mail,
          SellerId,
          SellerName,
        ],
      }),
    })
      .then(function (response) {
        return response.json();
      })
      .then(function (data) {
        alert("Consumer added successfully");
        console.log(data);
        var token = document.getElementById("tx_id");
        token.innerHTML = data.result.tx_id;
        window.location.href = "http://localhost:3000/addconsumer";
      })
      .catch((error) => console.error("Error:", error));
  }

  return (
    <div>
      <div class={styles.topnav}>
        <a href="/">Home</a>
        <a href="register">Register</a>
        <a href="login">Login</a>
        <a href="changeowner">Change Owner</a>
        <a href="authenticate">Authenticate</a>
        <a href="queryall">Query All Products</a>
        <a class={styles.active} href="addconsumer">
          Add Consumer
        </a>
        <a href="addseller">Add Seller</a>
      </div>
      <h1>Add Consumer</h1>
      <form onSubmit={AddConsumer}>
        <input
          value={Consumer}
          onChange={(e) => setConsumer(e.target.value)}
          type="text"
          placeholder="Consumer Number"
        />
        <br />
        <input
          value={ProductName}
          onChange={(e) => setProductName(e.target.value)}
          type="text"
          placeholder="Product Name"
        />
        <br />
        <input
          value={ProductId}
          onChange={(e) => setProductId(e.target.value)}
          type="text"
          placeholder="Product ID"
        />
        <br />
        <input
          value={SellerId}
          onChange={(e) => setSellerId(e.target.value)}
          type="text"
          placeholder="Seller ID"
        />
        <br />
        <input
          value={SellerName}
          onChange={(e) => setSellerName(e.target.value)}
          type="text"
          placeholder="Seller Name"
        />
        <br />
        <input
          value={Name}
          onChange={(e) => setName(e.target.value)}
          type="text"
          placeholder="Consumer Name"
        />
        <br />
        <input
          value={Address}
          onChange={(e) => setAddress(e.target.value)}
          type="text"
          placeholder="Address"
        />
        <br />
        <input
          value={Contact}
          onChange={(e) => setContact(e.target.value)}
          type="text"
          placeholder="Contact Number"
        />
        <br />
        <input
          value={Mail}
          onChange={(e) => setMail(e.target.value)}
          type="text"
          placeholder="Mail Id"
        />
        <br />

        <h4 id="tx_id"></h4>
        <input type="submit" value="Add Consumer" />
      </form>
    </div>
  );
}

export default App;
